// PokemonDetails.tsx

import React from "react";

interface PokemonDetailsProps {
  pokemon: {
    name: string;
    url: string;
  };
  onClose: () => void;
}

const PokemonDetails: React.FC<PokemonDetailsProps> = ({
  pokemon,
  onClose,
}) => {
  // Implementa lógica para obtener detalles adicionales del Pokémon si es necesario
  // Puedes hacer una nueva llamada a la API usando la URL del Pokémon

  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>
          &times;
        </span>
        <h2>{pokemon.name}</h2>
        {/* Mostrar otros detalles del Pokémon aquí */}
      </div>
    </div>
  );
};

export default PokemonDetails;
